import React from "react";
import GenModel from "./GenModel/GenModel";
/* import "./GenModelsHello.scss"; */


const GenModelsHello = (props) => {

 /* start test */
 //console.log(props)

const handleChangeFrequencyType = event => {
  //props.filterFrequencyTypeAC(event.target.value)
  console.log ('look: ' + event.target.value)
  //props.filterFrequencyTypeTC(event.target.value)
  //props.tt(event.target.value)

};

/* console.log('PPPROPS: ' + props) */
 /* end test */

const genModel = props.gen_models.models.map((x, index) => {
  return (

      <GenModel
      key={x.id}
      genModelId={x.id} 
      genModelTitle={x.name} 
      genModelPackaging={x.packaging} 
      genModelPicture={x.pictureName}
      genModelIsActive ={x.isActive}
      />      
  );
})


  return (
    <>
      <div className="gen-models-filter__wrap">
        <h2>Quick Filter</h2>
        <form>
        <input type="radio" id="summer" value="Summer" onClick={props.filterFrequencyFundamentalTC} />
        <label>Fundamental</label>

        <input type="radio" id="summer2" value="Summer2" onClick={props.filterFrequencyMultiplicationTC} />
        <label>with multiplication</label>

{/*         <input type="radio" id="summer" value="Summer">Summer</input>  
<input type="radio" id="winter" value="Winter">Winter</input>  */} 

          <div>
            <button type="submit">Subscribe</button>
          </div>
        </form>

<form>
  What color do you prefer?
  <input type="radio" name="colors" id="red">Red </input>
  <input type="radio" name="colors" id="blue">Blue </input>
</form>

        <label>
          FrequencyType
          <select
            value={props.gen_models.filterFrequencyType}
            onChange={handleChangeFrequencyType}
          >
            {props.gen_models.frequencyType.variantType.map((value, index) => (
              <option key={index} value={value}>
                {value}
              </option>
            ))}
          </select>
        </label>
      </div>

      <div className="gen-models__wrap">
        <h2>Generator Types</h2>
        <div className="gen-models">{genModel}</div>
      </div>

      <div>
        {" "}
        <p>GenModelsHello Props:</p>
        <pre>{JSON.stringify(props, null, 2)}</pre>
      </div>
    </>
  );
};

export default GenModelsHello;
